var timeout = null;
var images = [];
var chosenIndex = [];
var failedCount = 0;
var scratch1, scratch2, scratch3;
var ctx1, ctx2, ctx3;
var selectedBoxId;
var ongoingTouches = [];
var brush = new Image();
var isDrawing, lastPoint;
let canvasHeight = 100;
let canvasWidth = 100;
const prizeSrc =
  "data:image/png;base64,";
brush.src =
  "data:image/png;base64,";
let zonkSrc =
  "data:image/png;base64,";

function distanceBetween(point1, point2) {
  return Math.sqrt(
    Math.pow(point2.x - point1.x, 2) + Math.pow(point2.y - point1.y, 2)
  );
}

function angleBetween(point1, point2) {
  return Math.atan2(point2.x - point1.x, point2.y - point1.y);
}

// Only test every `stride` pixel. `stride`x faster,
// but might lead to inaccuracy
function getFilledInPixels(stride, ctx) {
  // if (!stride || stride < 1) {
  //   stride = 1;
  // }

  // var pixels = ctx.getImageData(0, 0, canvasWidth, canvasHeight),
  //   pdata = pixels.data,
  //   l = pdata.length,
  //   total = l / stride,
  //   count = 0;

  // // Iterate over all pixels
  // for (var i = (count = 0); i < l; i += stride) {
  //   if (parseInt(pdata[i]) === 0) {
  //     count++;
  //   }
  // }

  // return Math.round((count / total) * 100);
  // let ctx = "";
  // if (id === "scratch-1") {
  //   ctx = ctx1;
  // } else if (id === "scratch-2") {
  //   ctx = ctx2;
  // } else if (id === "scratch-3") {
  //   ctx = ctx3;
  // }
  const data = ctx.getImageData(0, 0, canvasWidth, canvasHeight).data;

  // The total number of pixels is the length of the
  // data array divided by 4, or width * height
  const nrOfPixels = data.length / 4; // rgba pixels
  let transparent = 0;

  // Your code removes the alpha, so we check each
  // 4th item in the array (notice the += 4)
  // If it's transparent (A === 0), we count it
  for (let i = 3; i < data.length; i += 4) {
    transparent += data[i] ? 0 : 1;
  }

  // The percentage is the number of transparent pixels
  // divided by the total number of pixels
  const percentage = (transparent / nrOfPixels) * 100;
  return percentage;
}

function getMouse(e, canvas) {
  var offsetX = 0,
    offsetY = 0,
    mx,
    my;
  if (canvas.offsetParent !== undefined) {
    do {
      offsetX += canvas.offsetLeft;
      offsetY += canvas.offsetTop;
    } while ((canvas = canvas.offsetParent));
  }
  mx = (e.pageX || e.touches[0].clientX) - offsetX;
  my = (e.pageY || e.touches[0].clientY) - offsetY;

  return { x: mx, y: my };
}

function handlePercentage(filledInPixels, canvas) {
  filledInPixels = filledInPixels || 0;
  if (filledInPixels > 50) {
    // canvas.parentNode.removeChild(canvas);
    canvas.remove();
    isDrawing = false;
    lastPoint = 0;
    if (selectedBoxId === canvas.id) {
      document.getElementById("revealPrize").style.display = "initial";
      document.getElementById("gameText").innerText =
        "wow congratulations and you are the lucky winner";
    }
  }
}

function handleMouseDown(e) {
  isDrawing = true;
  let canvas = "";
  if (e.target.id === "scratch-1") {
    canvas = scratch1;
  } else if (e.target.id === "scratch-2") {
    canvas = scratch2;
  } else if (e.target.id === "scratch-3") {
    canvas = scratch3;
  }
  lastPoint = getMouse(e, canvas);
}

function handleMouseMove(e) {
  if (!isDrawing) {
    return;
  }

  e.preventDefault();
  let canvas = "";
  let ctx = "";
  if (e.target.id === "scratch-1") {
    canvas = scratch1;
    ctx = ctx1;
  } else if (e.target.id === "scratch-2") {
    canvas = scratch2;
    ctx = ctx2;
  } else if (e.target.id === "scratch-3") {
    canvas = scratch3;
    ctx = ctx3;
  }
  var currentPoint = getMouse(e, canvas),
    dist = distanceBetween(lastPoint, currentPoint),
    angle = angleBetween(lastPoint, currentPoint),
    x,
    y;
  for (var i = 0; i < dist; i++) {
    x = lastPoint.x + Math.sin(angle) * i - 25;
    y = lastPoint.y + Math.cos(angle) * i - 25;
    ctx.globalCompositeOperation = "destination-out";
    ctx.drawImage(brush, Math.abs(x), Math.abs(y));
  }

  lastPoint = currentPoint;
  handlePercentage(getFilledInPixels(32, ctx), canvas);
}

function handleMouseUp(e) {
  isDrawing = false;
}
attachEventListener = function (canvas, ctx) {
  var isMobile = /iPhone|iPad|iPod|Android/i.test(navigator.userAgent);
  if (!isMobile) {
    canvasHeight = canvasWidth = 175;
    let list = document.getElementsByClassName("scratch-placeholder");
    for (let l of list) {
      l.src = zonkSrc;
      l.style.width = "150px";
      l.style.height = "150px";
    }
  }
  canvas.width = canvasWidth;
  canvas.height = canvasHeight;
  ctx.fillStyle = "green";
  ctx.fillRect(0, 0, canvasWidth, canvasHeight);
  canvas.addEventListener("mousedown", handleMouseDown, false);
  canvas.addEventListener("touchstart", handleMouseDown, false);
  canvas.addEventListener("mousemove", handleMouseMove, false);
  canvas.addEventListener("touchmove", handleMouseMove, false);
  canvas.addEventListener("mouseup", handleMouseUp, false);
  canvas.addEventListener("touchend", handleMouseUp, false);
};
function setBackgroundImages() {
  let boxNumber = getRandomInt(3) + 1;
  selectedBoxId = `scratch-${boxNumber}`;
  document.getElementById(
    `scratch-img-${boxNumber}`
  ).src = `${images[chosenIndex]}`;
}
function getRandomInt(max) {
  return Math.floor(Math.random() * Math.floor(max));
}
function setChance(percentage, imageUrl) {
  for (let i = 0; i < percentage; i++) {
    images.push(imageUrl);
  }
}
document.body.onload = function () {
  scratch1 = document.getElementById(`scratch-1`);
  ctx1 = scratch1.getContext("2d");
  scratch2 = document.getElementById(`scratch-2`);
  ctx2 = scratch2.getContext("2d");
  scratch3 = document.getElementById(`scratch-3`);
  ctx3 = scratch3.getContext("2d");
  attachEventListener(scratch1, ctx1);
  attachEventListener(scratch2, ctx2);
  attachEventListener(scratch3, ctx3);
  setChance(50, prizeSrc);

  while (images.length < 100) {
    images.push(zonkSrc);
    failedCount++;
  }

  chosenIndex = getRandomInt(images.length);
  // chosenIndex = 10;
  if (chosenIndex < 50) {
    setBackgroundImages();
  }
};
